// src/pages/Dono/DonoDetails.jsx
import React, { useEffect, useState } from 'react';
import { useParams, Link, useNavigate } from 'react-router-dom';
import api from '../../services/api';

const DonoDetails = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [dono, setDono] = useState(null);
  const [pets, setPets] = useState([]);

  useEffect(() => {
    api.get(`/donos/${id}`)
      .then(res => setDono(res.data))
      .catch(err => console.error('Erro ao carregar dono:', err));
  }, [id]);

  useEffect(() => {
    api.get(`/pets?dono=${id}`)
      .then(res => setPets(res.data))
      .catch(err => console.error('Erro ao carregar pets do dono:', err));
  }, [id]);

  const handleDelete = () => {
    if (window.confirm('Deseja realmente excluir este dono?')) {
      api.delete(`/donos/${id}`)
        .then(() => navigate('/donos'))
        .catch(() => alert('Falha ao excluir dono'));
    }
  };

  if (!dono) return <div>Carregando...</div>;

  return (
    <div className="container my-5">
      <div className="p-4 border rounded shadow-sm bg-white mb-4">
        <div className="d-flex justify-content-between align-items-center mb-4">
          <h2>Detalhes do Dono</h2>
          <div>
            <Link to="/home" className="btn btn-secondary me-2">← Voltar ao Início</Link>
            <Link to="/donos" className="btn btn-dark">Ver Donos</Link>
          </div>
        </div>

        <ul className="list-group list-group-flush">
          <li className="list-group-item"><strong>Nome:</strong> {dono.nome}</li>
          <li className="list-group-item"><strong>CPF:</strong> {dono.cpf}</li>
          <li className="list-group-item"><strong>Endereço:</strong> {dono.endereco}</li>
          <li className="list-group-item"><strong>Telefone:</strong> {dono.telefone}</li>
          <li className="list-group-item"><strong>Email:</strong> {dono.email}</li>
          <li className="list-group-item"><strong>Data de Nascimento:</strong> {dono.dataNascimento}</li>
          <li className="list-group-item"><strong>Responsável:</strong> {dono.responsavel ? 'Sim' : 'Não'}</li>
          <li className="list-group-item"><strong>Ativo:</strong> {dono.ativo ? 'Sim' : 'Não'}</li>
          {dono.observacoes && <li className="list-group-item"><strong>Observações:</strong> {dono.observacoes}</li>}
          <li className="list-group-item"><strong>Data de Cadastro:</strong> {new Date(dono.createdAt).toLocaleDateString()}</li>
        </ul>

        <div className="mt-3">
          <Link to={`/donos/${id}/editar`} className="btn btn-warning me-2">Editar</Link>
          <button className="btn btn-danger" onClick={handleDelete}>Excluir</button>
        </div>
      </div>

      <div className="p-4 border rounded shadow-sm bg-white">
        <h4>Pets cadastrados</h4>
        {pets.length === 0 ? (
          <p>Não há pets cadastrados para este dono.</p>
        ) : (
          <ul className="list-group list-group-flush">
            {pets.map(pet => (
              <li key={pet._id} className="list-group-item d-flex justify-content-between align-items-center">
                <span>{pet.nome} — {pet.tipo}, {pet.raca}</span>
                <Link to={`/pets/${pet._id}`} className="btn btn-sm btn-primary">Ver Detalhes</Link>
              </li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

export default DonoDetails;
